css:
.editor-colors {
  background-color: #2e3239;
  color: #f8f8f2;
}
.editor .invisible-character {
  color: rgba(197, 200, 198, 0.2);
}
.editor .indent-guide {
  color: rgba(255, 255, 255, 0.15);
}
.editor .wrap-guide {
  background-color: rgba(255, 255, 255, 0.1);
}
.editor .gutter {
  background-color: #2e3239;
}
.editor .gutter .cursor-line {
  color: #f8f8f2;
}
.editor .line-number.cursor-line-no-selection {
  background-color: #343D46;
}
.editor .invisible {
  color: #f8f8f2;
}
.editor .cursor {
  border-color: #f8f8f0;
}
.editor .selection .region {
  background-color: #454b55;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #888888;
}
.editor .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.editor .comment {
  color: #677080;
}
.editor .string {
  color: #E6DB74;
}
.editor .constant.numeric {
  color: #AE81FF;
}
.editor .constant.language {
  color: #AE81FF;
}
.editor .constant.character,
.editor .constant.other {
  color: #AE81FF;
}
.editor .keyword {
  color: #F92672;
}
.editor .storage {
  color: #F92672;
}
.editor .storage.type {
  font-style: italic;
  color: #66D9EF;
}
.editor .entity.name.class {
  text-decoration: underline;
  color: #A6E22E;
}
.editor .entity.other.inherited-class {
  font-style: italic;
  text-decoration: underline;
  color: #A6E22E;
}
.editor .entity.name.function {
  color: #A6E22E;
}
.editor .entity.name.instance {
  color: #66D9EF;
}
.editor .variable.parameter {
  font-style: italic;
  color: #FD971F;
}
.editor .entity.name.tag {
  color: #F92672;
}
.editor .entity.other.attribute-name {
  color: #A6E22E;
}
.editor .support.function {
  color: #66D9EF;
}
.editor .support.constant {
  color: #66D9EF;
}
.editor .support.type,
.editor .support.class {
  font-style: italic;
  color: #66D9EF;
}
.editor .invalid {
  color: #F8F8F0;
  background-color: #F92672;
}
.editor .invalid.deprecated {
  color: #F8F8F0;
  background-color: #AE81FF;
}
.editor .class.jade {
  color: #AE81FF;
}
.editor .gfm .markup.heading {
  color: #A6E22E;
  font-weight: bold;
}
.editor .gfm .markup.underline {
  color: #E6DB74;
  text-decoration: underline;
}
.editor .gfm .bold {
  font-weight: bold;
}
.editor .gfm .italic {
  font-style: italic;
}
.editor .gfm .raw {
  color: #66D9EF;
}
.editor .gfm .variable.list {
  color: #F92672;
  font-weight: bold;
}
.editor .gfm .link {
  color: #CCC;
}
.editor .gfm .link .entity {
  color: #AE81FF;
}
.editor .gutter .line-number.git-line-added,
.editor.react .gutter .line-number.git-line-added {
  border-left: 2px solid #A6E22E;
}
.editor .gutter .line-number.git-line-modified,
.editor.react .gutter .line-number.git-line-modified {
  border-left: 2px solid #E6DB74;
}
.editor .gutter .line-number.git-line-removed,
.editor.react .gutter .line-number.git-line-removed {
  border-left: 2px solid #F92672;
}
.editor .fold-marker:after {
  font-size: 1.6em;
  line-height: 0.8;
  width: 1.2em;
  position: relative;
  top: 2px;
}
.term2 {
  border: 5px solid #2e3239;
}
.terminal {
  background-color: #2e3239 !important;
}
.terminal .cursor {
  background-color: #fff;
}
.terminal .color-0 {
  color: #f8f8f2;
}
.terminal .color-1 {
  color: #F92672;
}
.terminal .color-2 {
  color: #A6E22E;
}
.terminal .color-3 {
  color: #E6DB74;
}
.terminal .color-6 {
  color: #66D9EF;
}
.terminal pre.line span.character {
  font-size: 14px;
}
.cli-status .status-running {
  color: #66D9EF;
}
.cli-status .status-error {
  color: #F92672;
}
.cli-status .status-success {
  color: #A6E22E;
}
.cli-status .terminal {
  background-color: #25282e !important;
  border: 5px solid #25282e;
}
.cli-status .panel-heading .btn {
  font-size: 12px;
}
.cli-status .panel-heading .btn .icon-x {
  position: relative;
  top: 1px;
}
.list-group .selected:before,
.list-tree .selected:before {
  background: none;
}
.with-minimap .vertical-scrollbar {
  opacity: 0;
  width: 0;
}
.minimap {
  left: 93%;
  width: 7%;
}
